svg.script:

/* The variables that depend on tokenId are stored at the beginning so it's easy to assemble the SVG 
ANYTHING BETWEEN THE SQUARE BRACKETS WILL NOT BE PART OF THE FINAL HTML */
var [seed, quotes] = [
	(Math.random() * 4294967296) >>> 0,
	[
		"If crypto succeeds, it's not because\n it empowers better people, it's because\n it empowers better institutions.",
		"Institutional",
		"Bitcoin is great as a form of digital\n money, but its scripting language is \ntoo weak for any kind of serious\n advanced applications to be built \non top.",
		"Scripter"
	]
];


// Seeded PRNG
const rnd = function () {
	var t = (seed += 0x6d2b79f5);
	t = Math.imul(t ^ (t >>> 15), t | 1);
	t ^= t + Math.imul(t ^ (t >>> 7), t | 61);
	return ((t ^ (t >>> 14)) >>> 0) / 4294967296;
};

// Exponential PRNG
const rndExp = function () {
	return -Math.log(1.0 - rnd()) * 20;
};

const fidenzaPalette = [
	"#DB4F54",
	"#D12A2F",
	"#E57D32",
	"#FCBC19",
	"#FCD265",
	"#29A691",
	"#7CA9BF",
	"#315F8C",
	"#F7B1A1",
	"#B8D9CE",
	"#E0D7C5",
	"#543E2E",
	"#1F335D",
	"#3B2B20",
	"#121A33",
	"#261C15"
];

// Setting the frame color
const frameColorId = Math.floor(rnd() * fidenzaPalette.length);
const frameColorId2 = Math.floor(rnd() * fidenzaPalette.length);
document.getElementById("circuitFill").setAttribute("fill", fidenzaPalette[frameColorId]);
document.getElementById("titleLabel").setAttribute("fill", fidenzaPalette[frameColorId]);
document.getElementById("subtitleLabel").setAttribute("fill", fidenzaPalette[frameColorId]);
document.getElementById("description").setAttribute("fill", fidenzaPalette[frameColorId]);

// Changing the background
document.getElementById("circuit").setAttribute("patternTransform", `rotate(${rnd() * 360})`);

// Setting random corners
document
	.getElementById("titlePath")
	.setAttribute(
		"d",
		`M10 8 l-2 ${rnd() < 0.5 ? "0" : "2"} V12.82842712475 l${rnd() < 0.5 ? "0" : "2"} 2 H90 l2 ${
			rnd() < 0.5 ? "0" : "-2"
		} V10 l${rnd() < 0.5 ? "0" : "-2"} -2 Z`
	);

document
	.getElementById("subtitlePath")
	.setAttribute(
		"d",
		`M10 81.1084271247 l-3 ${rnd() < 0.5 ? "0" : "3"} V84.1084271247 l${
			rnd() < 0.5 ? "0" : "3"
		} 3 H90 l3 ${rnd() < 0.5 ? "0" : "-3"} V84.1084271247 l${rnd() < 0.5 ? "0" : "-3"} -3 z`
	);

// Setting the protrusions for the image element
const generateProtrudedPath = function (y0, height) {
	let lenInc = rndExp();
	let len = lenInc + 1;
	let left = rnd() < 0.5;
	let d = `M${left ? "10" : "11"} ${y0}`;
	while (len <= height) {
		d += ` v${lenInc}`;
		d += ` l${left ? "" : "-"}1 1`;
		left = !left;

		lenInc = rndExp();
		len += lenInc + 1;
	}
	left = rnd() < 0.5;
	d += ` V${y0 + height} H${left ? "89" : "90"}`;
	lenInc = rndExp();
	len = lenInc + 1;
	while (len <= height) {
		d += ` v-${lenInc}`;
		d += ` l${left ? "" : "-"}1 -1`;
		left = !left;

		lenInc = rndExp();
		len += lenInc + 1;
	}
	d += ` V${y0} Z`;
	return d;
};

let d = generateProtrudedPath(15.82842712475, 64.28);
document.getElementById("imagePath").setAttribute("d", d);

d = generateProtrudedPath(88.1084271247, 43.8915728753);
document.getElementById("descriptionPath").setAttribute("d", d);

// Javascript script to wrap text in description
const index = Math.floor((rnd() * quotes.length) / 2);
const descriptionText = quotes[index * 2];
const subtitleText = quotes[index * 2 + 1];
const lines = descriptionText.split("\n");
lines[0] = "\u201c" + lines[0];
lines[lines.length - 1] = lines[lines.length - 1] + "\u201d";
lines.forEach((line, ind) => {
	const lineElement = document.getElementById(`line${ind + 1}`);
	lineElement.appendChild(document.createTextNode(line));
	lineElement.setAttribute("class", "fontQuote");
});

// Setting the subtitle
const subtitleElement = document.getElementById("subtitleText");
subtitleElement.appendChild(document.createTextNode(subtitleText));
